Territory of Washington Spokane County}ss. In the District Court of the Fourth Judicial District holding terms at Cheney.
In the matter of the application of Willis D. Coyle for a writ of Habeas Corpus}
To E.F. Whittier, sheriff of said county. In the name of the United States you are commanded to have the body of W.D. Coyle by you imprisoned and detained, as it is said, together with the time and cause of such imprisonment and detention by whatsoever name said W.D. Coyle shall be called or charged by Goerge Turner, Judge of the Disctrict Court of Washington Territory and the Fourth Judicial District, at his office in the town of Spokane Falls, in Spokane county on the third day of July 1885 at the time of one o'clock, P.M. of that day to do and receive what shall then and there be considered concerning the said W.D. Coyle and have you then and there this writ. Witness the Hon. George Turner, Judge of said court at the city of Spokane Falls, county of Spokane. Witness my hand and seal of said court this third day of July, 1885 D.A. Clements, Clerk
